import {View, Text, ScrollView} from 'react-native';
import React from 'react';
import Row from '../components/Row';
import Player from './Player';
import PlayerMinimized from './playerMinimized';
import SpotifyRecommendations from '../data/spotifyApi'

class HomeScreen extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data: {},
        };
    }

    async componentDidMount() {
        const results = await SpotifyRecommendations();
        this.setState({data: results});
    }

    render() {
        return (
            <View>
                <ScrollView overScrollMode="never">
                    <Row navigation={this.props.navigation} tituloSeccion="Canciones" data={this.state.data} />
                </ScrollView>
            </View>
        );
    }
}

export default HomeScreen;
